import React from "react";
import {
  useBrandSourceMappings,
  useWaterBrands,
  useWaterSources,
} from "../../custom-hooks";
import "./table.css";

const Table = () => {
  const columns = [
    "브랜드",
    "제조원",
    "수질적합여부",
    "부적합판정횟수",
    "출시일",
  ];

  //api 호출
  const waterBrands = useWaterBrands();
  const waterSources = useWaterSources();
  const brandSourceMappings = useBrandSourceMappings();

  //데이터 편집
  for (let i = 0; i < waterBrands.length; i++) {
    waterBrands[i].sources = [];
  }

  for (let i = 0; i < waterSources.length; i++) {
      waterSources[i].testHistory = [];
  }

  console.log(waterBrands);

  return (
    <div className="tableWrapper">
      <table className="tableTable">
        <thead>
          <tr>
            {columns.map((column, index) => (
              <th key={index}>{column}</th>
            ))}
          </tr>
        </thead>
        <tbody>
          {waterBrands.map((waterBrand, index) => (
            <tr key={index}>
              <td>{waterBrand.name}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Table;
